import './App.css';
import Home from './components/home';
import Login from './components/login';
import { Routes,Route } from 'react-router-dom';

function App() {
  return (
    <>
    <Login/>
    <Routes>
      <Route path='/login' element={<Login></Login>}></Route>
      <Route path=',home' element={<Home></Home>}/>


    </Routes>
    </>
  );
}

export default App;
